    false,nt"url": null,nt"notes": "This data set contains records of all individually
    identified Hawaiian monk seals since 1981.   These seals were identified by PSD
    personnel and cooperating scientists as part of the ongoing monk seal population
    assessment efforts.  In addition, this data set contains records for all seals tagged
    by USFWS in earlier years and still present in the population when the current research
    effort began, and also contains some miscellaneous earlier records extending back
    as far as 1962.   MasterID data are contained in two record types, the "Seal"
    record containing information that doesn't change over the seal's lifetime (ex.,
    sex, birth date and location, mother, death date) and the "Annual" record containing
    information that changes annually (ex., size, pupping and molting information, location
    that year, and applied bleach marks).",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
